.cucumber-report-header {
  width: 100%;

@media only screen and (min-width: 600px) {

.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 2px;
}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;

window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"15.0.0","implementation":{"name":"cucumber-jvm","version":"6.11.0"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"22.0.2+9-70"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":"1726657167","nanos":573129800}}},{"source":{"uri":"file:///C:/Users/Divya.Ramadas/IdeaProjects/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/OrderControlListFeature_OMS/orderControlListFeatureOMS.feature","data":"Feature: Order control list\r\n  Used for cration of order for OCL, searching etc\r\n\r\n  Background: For login to application and selecting Account#\r\n    Given User enters URL and is on login page and entered credentials for OCL\r\n    When User is on Home Page for OCL\r\n    Then User navigate to Client side for OCL\r\n    Then User should select Order Entry tab for OCL\r\n    #Then User selects Account# for OCL\r\n\r\n  @CreateOrderWithNote\r\n  Scenario: For creating order in OCL and Order has been created with order note\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User Clicks on Untaken radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    Then User clicks on Order icon in OCL grid\r\n    Then User should select Note from popup and Order guide from popup for OG\r\n    And User validate that he is in NewOE page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Add product drop down and select catalog option\r\n    And User should select Product from catalog and Enter Qty for the products for OCL\r\n      |1|1|\r\n    Then User should click on Comment icon in Order entry card\r\n    And User should enter comment in comment popup\r\n      |Comment at Order level for OCL|Order notes|\r\n    Then Click on Next button and select option Continue without payment option\r\n    And Click on Submit Order button and read Order_no for OCL\r\n    Then User should select Note from popup and Order guide from popup for OCL\r\n    Then User validate that he is in NewOE page for OCL\r\n    And User Clicks on Back button in NewOE page and User must be in OCL page\r\n\r\n  @OrderCommentInOCL\r\n  Scenario: Test scenario to find the comment added to Order in OCL\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User Clicks on Taken radio button\r\n    And User enters OrderNo in search box to search for order\r\n    Then User finds the comment for order in OCL\r\n\r\n  @OrderCreatedBy\r\n  Scenario: Test scenario for verifying whether Created by column is a displayed and it contains created by user details\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User Clicks on Untaken radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    Then User clicks on Order icon in OCL grid\r\n    Then User should select Note from popup and Order guide from popup\r\n    And User validate that he is in NewOE page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Add product drop down and select catalog option\r\n    And User should select Product from catalog and Enter Qty for the products for OCL\r\n      |1|1|\r\n    Then Click on Next button and select option Continue without payment option\r\n    And Click on Submit Order button and read Order_no for OCL\r\n    Then User should select Note from popup and Order guide from popup for OCL\r\n    Then User validate that he is in NewOE page for OCL\r\n    And User Clicks on Back button in NewOE page and User must be in OCL page\r\n    Then User Clicks on Taken radio button\r\n    And User should verify Order number created in OCL grid\r\n    And User verify created by column value\r\n\r\n  @VerifyOrderType\r\n  Scenario: Test scenario for verifying Order Type in OCL once order is created via OCL. Here Regular order has been created,and same has been passed as parameter\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User Clicks on Untaken radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    Then User clicks on Order icon in OCL grid\r\n    Then User should select Note from popup and Order guide from popup\r\n    And User validate that he is in NewOE page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Add product drop down and select catalog option\r\n    And User should select Product from catalog and Enter Qty for the products for OCL\r\n      |1|1|\r\n    Then Click on Next button and select option Continue without payment option\r\n    And Click on Submit Order button and read Order_no for OCL\r\n    Then User should select Note from popup and Order guide from popup for OCL\r\n    Then User validate that he is in NewOE page for OCL\r\n    And User Clicks on Back button in NewOE page and User must be in OCL page\r\n    Then User Clicks on Taken radio button\r\n    And User should verify Order number created in OCL grid and Order type in OCL\r\n\r\n  @AddFilterInOCL\r\n  Scenario: Filtering of OCL details using customer account# using AddFilter\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User clicks on Add filter button and enter value for first search box and second search box\r\n      |Customer key|\r\n\r\n  @SkipInOCL\r\n  Scenario: For skipping order from OCL\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User Clicks on Untaken radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    Then User select OCL which is not skipped\r\n    And User Clicks on Skip button and validates the skip popup selects the reason\r\n      |closed|\r\n    Then User validates skip option\r\n\r\n  @VerifySkipInTaken\r\n  Scenario: Test scenario for verifying skip under taken orders\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User Clicks on Taken radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    And User verifies existence of customer account for which skip is enabled, exists under taken\r\n\r\n  @RemoveSkip\r\n  Scenario: For remove skipping order from OCL\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User Clicks on Taken radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    And User verifies existence of customer account for which skip is enabled, exists under taken\r\n    Then User select OCL which is skipped\r\n    And User handles Remove skip popup\r\n    Then User validates Not skip option\r\n\r\n  @DragAndDrop\r\n  Scenario:Test scenario to Drag and drop OCL header\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    And User clicks on All radio button\r\n    Then User should drag and drop grid header\r\n      |Customer|\r\n\r\n  @CreatePendingOrder\r\n  Scenario: Test scenario for creating pending order via OCL\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User Clicks on Untaken radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    Then User clicks on Order icon in OCL grid\r\n    Then User should select Note from popup and Order guide from popup\r\n    And User validate that he is in NewOE page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Add product drop down and select catalog option\r\n    And User should select Product from catalog and Enter Qty for the products for OCL\r\n      |1|1|\r\n    Then Click on Back button to handle Pending order Popup\r\n    And Popup message for Pending order should be displayed\r\n    Then User should be navigated to Order control list page\r\n\r\n  @PrintOCL\r\n  Scenario: Test scenario for printing OCL\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User clicks on Print button and handle the new browser window\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Divya.Ramadas/IdeaProjects/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/OrderControlListFeature_OMS/orderControlListFeatureOMS.featur ":[{"name":"@PrintOCL","astNodeId":"4109f2d8-900c-4983-8277-9dda84f560ac"}],"astNodeIds":["237a5987-e74e-431c-b5d0-e33a28ee9400"]}},{"source":{"uri":"file:///C:/Users/Divya.Ramadas/IdeaProjects/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/OrderControlListFeature_OMS/orderControlListFeatureOMS1.feature","data":"Feature: Order control list1\r\n  Used for cration of order for OCL, searching etc\r\n\r\n  Background: For login to application and selecting Account#\r\n    Given User enters URL and is on login page and entered credentials for OCL\r\n    When User is on Home Page for OCL\r\n    Then User navigate to Client side for OCL\r\n    Then User should select Order Entry tab for OCL\r\n\r\n  @SearchByRoute\r\n  Scenario: Test scenario to search based on Route_No in Route input box\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    And User clicks on All radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    Then User enters Route# in Route search input box and count number of rows in OCL grid\r\n\r\n  @CommentCustomerLevel\r\n  Scenario: Test scenario for adding comment at customer level\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    And User clicks on All radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    Then User should find the customer to whom comment has to be added and click on Comment icon\r\n    Then Add note in popup\r\n      |Testing for Notes at customer level_OCL|\r\n    And User should select the Alert Type and Alert location to display notes\r\n      |Both|Customer master|Order entry|\r\n    Then Click on Save button\r\n    And User should click on comment icon in OCL and verify customer note\r\n\r\n  @CopyingCustomerNoteInOCL\r\n  Scenario: Creating copy of customer note\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    And User clicks on All radio button\r\n    Then User should find the customer to whom comment has to be added and click on Comment icon\r\n    And Read all the Notes in Customer note grid and select one note\r\n      |Testing for Notes at customer level_OCL|\r\n    And Click on Copy button in Note grid\r\n    Then Click on Save button\r\n\r\n  @DeleteCustomerNoteInOCL\r\n  Scenario: Delet Customer note\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    And User clicks on All radio button\r\n    Then User should find the customer to whom comment has to be added and click on Comment icon\r\n    And Read all the Notes in Customer note grid and select one note for Deleting\r\n      |Testing for Notes at customer level_OCL|\r\n    Then Click on Ok button\r\n\r\n  @ResetCustomerNoteInOCL\r\n  Scenario: Test scenario for adding comment at customer level and resetting the customer note\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    And User clicks on All radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    Then User should find the customer to whom comment has to be added and click on Comment icon\r\n    And Read all the Notes in Customer note grid and select one note\r\n      |Testing for Notes at customer level_OCL|\r\n    Then Click on Reset button and Click on Ok button\r\n    And User should click on comment icon in OCL and verify customer note\r\n\r\n  @RefreshInOCL\r\n  Scenario: Test scenario for refreshing OCL, we can see the difference only when any other user is generating data in OCL\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then the application should display all the account number in the grid in OCL\r\n\r\n  @ChangeOfGrid\r\n  Scenario: Test scenario for changing grid in OCL\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User should gothrough the column names displayed\r\n    And User should change the grid and gothrough the column names displayed\r\n\r\n  @CallTimeFilter\r\n  Scenario: Test scenario for filter disabled for call time\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User should search for call time column and check whether filter has been disabled\r\n\r\n  @CallBackTimeFilter\r\n  Scenario: Test scenario for filter disabled for call back time\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User should search for call back time column and check whether filter has been disabled\r\n\r\n  @MultipleRoutes\r\n  Scenario: Test scenario for verifying selection of multiple routes\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    And User clicks on All radio button\r\n    Then User enters multiple Route# in Route search input box and count number of rows in OCL grid\r\n\r\n  @RemoveRoutes\r\n  Scenario: Test scenario for verifying functionality of removing of multiple routes\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    And User clicks on All radio button\r\n    Then User enters multiple Route# in Route search input box and count number of rows in OCL grid\r\n    And User remove route from search bar","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Divya.Ramadas/IdeaProjects/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/OrderControlListFeature_OMS/orderControlListFeatureOMS1.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Order control list1","description":"  Used for cration of order for OCL, searching etc","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"For login to application and selecting Account#","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","text":"User enters URL and is on login page and entered credentials for OCL","id":"1ce29235-1ecf-40de-bd49-6141a3968c61"},{"location":{"line":6,"column":5},"keyword":"When ","text":"User is on Home Page for OCL","id":"8d868b60-35d0-41eb-a4de-a7e174488ba1"},{"location":{"line":7,"column":5},"keyword":"Then ","text":"User navigate to Client side for OCL","id":"88a78d5b-489f-4d63-b442-0aefd9845c61"},{"location":{"line":8,"column":5},"keyword":"Then ","text":"User should select Order Entry tab fo should not display\r\n\r\n  @HardHoldSkip\r\n  Scenario: Test scenario for verifying while creating order hard hold will skip creation of order\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User Clicks on Untaken radio button\r\n    And User searches for Hard hold customer\r\n    Then User tries to create order for no hold customer which is preceding to hard hold\r\n    Then User should select Note from popup and Order guide from popup\r\n    And User validate that he is in NewOE page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Add product drop down and select catalog option\r\n    And User should select Product from catalog and Enter Qty for the products for OCL\r\n      |1|1|\r\n    Then Click on Next button and select option Continue without payment option\r\n    And Click on Submit Order button and read Order_no for OCL\r\n    Then User should select Note from popup and Order guide from popup for OCL\r\n    Then User validate that he is in NewOE page for OCL\r\n    And User should compare customer account number with hard hold with customer account number in newOE page\r\n    And User Clicks on Back button in NewOE page and User must be in OCL page\r\n    Then User Clicks on Taken radio button\r\n    And User should verify Order number created in OCL grid and Order type in OCL\r\n\r\n  @VerifyingCustomerNote\r\n  Scenario: Test scenario for verifying customer note in OCL\r\n    Given User must be on Order Entry Page to select OCL\r\n    And User should navigate to OCL\r\n    Then User should select Order taker from drop down\r\n    And Change the delivery date 2 days after current date\r\n    Then User Clicks on Untaken radio button\r\n    Then User should search for credit holder in OCL\r\n      |No Hold|\r\n    Then User should add customer note using Order control List\r\n    And User searches customer account#\r\n    Then User clicks on Order icon in OCL grid\r\n    Then User should verify Note content from popup and select Order guide from popup\r\n    And User validate that he is in NewOE page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Add product drop down and select catalog option\r\n    And User should select Product from catalog and Enter Qty for the products for OCL\r\n      |1|1|\r\n    Then Click on Next button and select option Continue without payment option\r\n    And Click on Submit Order button and read Order_no for OCL\r\n    Then User should select Note from popup and Order guide from popup for OCL\r\n    Then User validate that he is in NewOE page for OCL\r\n    And User Clicks on Back button in NewOE page and User must be in OCL page\r\n    Then User Clicks on Taken radio button\r\n    And User should verify Order number created in OCL grid in OMS\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Divya.Ramadas/IdeaProjects/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/OrderControlListFeature_OMS/orderControlListFeatureOMS2.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Order control list","description":"  Used for cration of order for OCL, searching etc","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"For login to application and selecting Account#","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","text":"User enters URL and is on login page and entered credentials for OCL","id":"cee75d8d-a419-44ec-baa9-4b90cc457c0a"},{"location":{"line":6,"column":5},"keyword":"When ","text":"User is on Home Page for OCL","id":"075cc00c-7cad-457d-bb42-f2cb24233dbb"},{"location":{"line":7,"column":5},"keyword":"Then ","text":"User navigate to Client side for OCL","id":"8997110f-2820-4c21-b
